import React from "react";
import logo from "./logo.svg";
import "./css/App.css";
import Jepifier from "./components/jepifier";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={jepLogo} className="App-logo" alt="logo" />
        <Jepifier />
      </header>
    </div>
  );
}

export default App;
